import './App.css';
import EventContainer from './containers/EventsContainer';
import {BrowserRouter as Router, Route} from "react-router-dom"

function App() {
  return (
    <div className="App">
    <h1>DisastroAlert</h1>
    <Router>
      <Routes>
        <Route path="/" element={<EventContainer />}/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
